import React,{Component} from 'react';
import axios from 'axios';

class Home extends Component {
    state={
        comments:[]
    }
    componentDidMount(){

        axios.get('https://cors-anywhere.herokuapp.com/https://www.youtube.com/watch?v=eicLNabvZN8')
         .then(res=>{
             console.log(res.data.slice(1,10))

         })

    } 
    render(){
    const {comments}=this.state;
    const comm = comments.length ? (
        comments.map(comment=>{
            return(
                <div key={comment.id}>
                    <div> {comment.name}</div><br></br>
                    <div> {comment.email}</div><br></br>
                    <div> {comment.body}</div><br></br>
                </div>
            )
        })
    ):(<div> No Posts yet.. </div>)


  return (
    <div>
        <h1>
            Home Page
        </h1>
        {comm}
    </div>
  );
}}

export default Home
